    const [clickedBook, setClickedBook] = useContext(BookHoldContext);
    return (
        <div className="bookdetail">
            <h2>{clickedBook.title}</h2>
            {/* <p>{console.log(clickedBook)}</p> */}
        </div>
    )
}

BookDetail.propTypes = {
    img: PropTypes.string,

}

export default BookDetail
